:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, John William and BUSBY, Sarah
  JWILLIAMS, Kenneth Stuart and LUDBROOK, Lillian Mary
  JWILLIAMS, John Dow and MacLAURIN, Catherine Annie (Nancy)
  03> WILLIAMS, John Dow m on 30.03.1932 to MacLAURIN, Catherine Annie (Nancy)
  b 14.04.1902 d 26.07.1975
  b 16.06.1906 d 24.04.1987
  John b. at Matahiia. He went to Huntley School, Marton, (1911-14) and then to Christ's College (1915-21).
  He excelled at sport, gaining recognition in cricket, rugby and gymnastics, at which he was champion in
  1921. He was also a keen tennis player. He was Head Prefect in 1921.
  On leaving school he worked on three well-known properties on the East Coast before returning to "Matahiia"
  Station to help his brother Charles with the management of the property. After his marriage to Nancy, they
  lived at "Matahiia" until 1945, raising two sons and two daughters. John took a keen interest in district
  affairs and held senior office in many organisations. He and Nancy were tireless workers for the war
  effort, supporting many patriotic shop days, Although he moved to near Gisborne, John continued to
  maintain a major interest in "Matahiia" Station. After their move they developed a new home and started a
  citrus orchard on a section of Nancy's inheritance. John served as an Anglican Church Synodsman and was
  involved in the planning and building of Te Wiremu House. He was chairman of the National Party which
  elected Mrs Esme Tombleson in 1960. Their new home was called "Okaihau" and was situated at Haxton near
  Gisborne.
  In 1960 Charles and John, the two major owners of "Matahiia", decided to divide the property and John
  called his block "Taitai" Station. He farmed it with a manager until 1971 when his son, John William
  Stuart, took over the property. In 1967 John and Nancy retired to town and sold the orchard to outside
  interests, and a portion of the bare land was left to their elder daughter, Philippa Broad.
  01> WILLIAMS, John William Stuart m on 26.05.1964 to STRACHAN, Joanna Jane
  b 29.07.1934
  b 06.08.1940
  Stuart b. and m, at Gisborne. Joanna, d/o Malcolm Hume Strachan and Norma Payne Brewer, b. at
  Hastings. Address: Keitha Place, Taupo.
  Stuart was educated at Hereworth School (1944-47) and Christ's College (1948-52). He played cricket
  and tennis and was in the 1st rugby XV in 1952. He also enjoyed taking part in drama and he had the
  leading role in "The Housemaster".
  After leaving school and completing his Compulsory Military Training, he started his farming career on
  an agricultural property near his parents' home. He then went on to a typical breeding property in
  Hawkes Bay for two years. In 1958 he took over the lease of "Mangarewarewa", a 400-acre block next to
  "Matahiia" Station which belonged to his great uncle and aunt, the Taplins.
  After his marriage to Joanna in 1964, they continued farming on the Coast until 1987 and raised their
  sons there. In 1971 Stuart took over his father's block, "Taitai" station and bought out all the other
  family members. He joined in many of the district activities and held senior positions in some
  organisations. Because of inherent erosion problems, Stuart sold "Taitai" to the Government for
  forestry in 1984, and in 1987 he sold "Mangarewarewa" to "Matahiia" and left the Coast to take up deer
  farming on a property known as "Sunninghill" in the Ashley Clinton district near Waipukurau.
  In 1996 Stuart and Joanna sold this property and they presently live at Kinloch on the shores of Lake
  Taupo,
  After her primary schooling at Te Puke, Joanna attended Samuel Marsden Collegiate in Wellington where
  she was a very successful student. She went on to train as a dental nurse, a career she followed until
  her marriage. She has been involved in charity work.
  01> WILLIAMS, Andrew John m on 09.02.1996 to DUNCAN, Belinda Jane
  b 29.08.1965
  b 22.08.1962
  Andrew b. at Gisborne and m, at Havelock North. Belinda, d/o John David Duncan and Edith
  Jacqueline O'Rorke, b. at Hastings. Address: PO Box 191, Hastings.
  Andrew was educated at Hereworth School (1975-77) and was in the 1st rugby XV, the 1st cricket XI,
  the 1st hockey XI and was Head Prefect. He went on to St Paul's Collegiate School in Hamilton
  where he was Head of House and in the 1st rugby XV for two years, and captain. After three years
  overseas, he worked on farms on the East Coast and in Canterbury. However, he left farming and is
  now manager of a home vacuum cleaning company in Napier. He enjoys golf and fishing.
  Jane was educated at Te Mata School, Havelock North, and Nga Tawa School, Marton. She graduated
  from Christchurch Polytechnic with a Certificate of Interior Decorating and Design before
  travelling overseas. She then became a receptionist for an accountancy firm in Hastings.
